%spark2


import org.apache.spark.sql.types.{StructType, StructField, StringType, DoubleType}
import org.apache.spark.sql.Row
import scala.collection.mutable.ListBuffer

val schema = StructType(
    StructField("FlightID", StringType, true) ::
    StructField("LatValue", StringType, true) ::
    StructField("LongValue", StringType, true) :: Nil)

val df_FlightsWithWayPoints = df_AllFightInfo.filter("_latitudeDecimal is not null and _longitudeDecimal is not null").select("_acid", "nxce:waypoint")

val list = df_FlightsWithWayPoints.select("_acid", "nxce:waypoint._latitudeDecimal", "nxce:waypoint._longitudeDecimal")

//list.take(1)

val rowList = ListBuffer[Row]()

for ( x <- list.collect() ) {
        // println( x(0))
        // println( x.getList(1) )
        // println( x.getList(1).size() )

        val LatList = x.getList(1) 
        val LongList = x.getList(2) 
        val ListSize =  x.getList(1).size()
        val index = 0

        for(index <- 0 to ListSize-1 )
         {
           // println( x(0) + " " + LatList.get(index).toString + " " + LongList.get(index) )
            val flightID =  x(0).toString
            val latitude = LatList.get(index).toString
            val longitude = LongList.get(index).toString

            val RowValue =  Row( flightID, latitude, longitude )

            rowList += RowValue
         }
}


val df_WayPointTemp = spark.createDataFrame( spark.sparkContext.parallelize(rowList.toList) , schema)
//df_WayPointTemp.printSchema()
//df_WayPointTemp.take(10)

val df_WayPoints = df_WayPointTemp.withColumn("LatitudeValue", df_WayPointTemp("LatValue").cast(DoubleType)).withColumn("LongitudeValue", df_WayPointTemp("LongValue").cast(DoubleType)) 
df_WayPoints.printSchema()
