%angular
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<div id="map" style="height: 500px; width: 100%"></div>

<script type="text/javascript">
function initMap() { 		
    var map = L.map('map').setView([31, -106], 4);
    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);
    var geoMarkers = L.layerGroup().addTo(map);

    var RedIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/123-red-dot.png',
    iconSize: [32, 32],
    });

    var BlueIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/22-blue-dot.png',
    iconSize: [32, 32],
    });

    var GreenIcon = L.icon({
    iconUrl: 'http://maps.google.com/mapfiles/ms/icons/green-dot.png',
    iconSize: [32, 32],
    });

    var YellowIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/157-yellow-dot.png',
    iconSize: [32, 32],
    });

    var el = angular.element($('#map').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.locationWatcher = el.scope().compiledScope.$watch('WayPoints', function(newValue, oldValue) {
            geoMarkers.clearLayers();
            angular.forEach(newValue, function(event) {
                if (event){

                    if(event.values[0] === "N467DM" )
                        var marker = L.marker([event.values[3], event.values[4]], {icon: BlueIcon}).bindPopup("Flight: "+ event.values[0]).addTo(geoMarkers);

                    else if(event.values[0] === "UAL788")
                        var marker = L.marker([event.values[3], event.values[4]], {icon: RedIcon}).bindPopup("Flight: "+ event.values[0]).addTo(geoMarkers);

                    else if(event.values[0] === "JBU554")
                        var marker = L.marker([event.values[3], event.values[4]], {icon: GreenIcon}).bindPopup("Flight: "+ event.values[0]).addTo(geoMarkers);

                    else
                        var marker = L.marker([event.values[3], event.values[4]], {icon: YellowIcon}).bindPopup("Flight: "+ event.values[0]).addTo(geoMarkers);
                }

            });
        })
    });
}

if (window.locationWatcher) { window.locationWatcher(); }

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>

%angular
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<div id="map" style="height: 500px; width: 100%"></div>

<script type="text/javascript">
function initMap() { 		
    var map = L.map('map').setView([31, -106], 5);
    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);
    var geoMarkers = L.layerGroup().addTo(map);

    var RedIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/123-red-dot.png',
    iconSize: [32, 32],
    });

    var BlueIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/22-blue-dot.png',
    iconSize: [32, 32],
    });

    //

    var el = angular.element($('#map').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.locationWatcher = el.scope().compiledScope.$watch('FlightLocations', function(newValue, oldValue) {
            geoMarkers.clearLayers();
            angular.forEach(newValue, function(event) {
                if (event){
                    var marker = L.marker([event.values[2], event.values[3]], {icon: BlueIcon}).bindPopup("Flight: "+ event.values[1] + " Speed: " + event.values[4] + " Time: " + event.values[5]).addTo(geoMarkers);
                }
            });
        })
    });

}

if (window.locationWatcher) { window.locationWatcher(); }

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
